import style from "./About.module.css"
const About = ()=>{
    
    return (
        <div>
        <h1 className={style.fuente}>Aplicacion creada en el marco de un proyecto integrador</h1>
        <h1 className={style.fuente}>Lugar: Santa fe, Argentina</h1>
        </div>
    );
};

export default About;
